// Async delete function that actually works on Node v24 + OneDrive
async function deleteFolder(folderPath) {
  if (existsSync(folderPath)) {
    await fs.rm(folderPath, { recursive: true, force: true });
    return true;
  }
  return false;
}

async function cleanupLetter(letter, targets) {
  const wordsDir = path.join(BASE_DIR, letter, '01_Words');

  if (!existsSync(wordsDir)) {
    console.log(`[${letter}] Directory not found: ${wordsDir}`);
    return { removed: 0, errors: 0 };
  }

  let removed = 0;
  let errors = 0;

  for (const target of targets) {
    const targetPath = path.join(wordsDir, target);
    try {
      if (await deleteFolder(targetPath)) {
        console.log(`[${letter}] Deleted: ${target}`);
        removed++;
      }
    } catch (err) {
      console.error(`[${letter}] Failed ${target}: ${err.message}`);
      errors++;
    }
  }

  return { removed, errors };
}

async function main() {
  console.log('='.repeat(60));
  console.log('DICTIONARY CLEANUP - Using async fs.rm (Node v24 fix)');
  console.log('='.repeat(60));
  console.log(`Base directory: ${BASE_DIR}\n`);

  let totalRemoved = 0;
  let totalErrors = 0;

  const letters = Object.keys(TARGETS).sort();

  for (const letter of letters) {
    const targets = TARGETS[letter];
    console.log(`\n--- Processing ${letter} (${targets.length} targets) ---`);

    const { removed, errors } = await cleanupLetter(letter, targets);
    totalRemoved += removed;
    totalErrors += errors;

    console.log(`[${letter}] Complete: ${removed} removed, ${errors} errors`);
  }

  console.log('\n' + '='.repeat(60));
  console.log('CLEANUP COMPLETE');
  console.log('='.repeat(60));
  console.log(`Total folders removed: ${totalRemoved}`);
  console.log(`Total errors: ${totalErrors}`);
  console.log('\nNext step: Run "npm run prepare" to update the site.');
}

main().catch(console.error);
